import "./OfferDetails.css";

import { useParams } from "react-router-dom";

import OfferService from "../../../../services/offer.service";
import { useEffect, useState } from "react";

export const OfferDetails = () => {
  const params = useParams();
  const [offer, setOffer] = useState([]);

  console.log(offer);

  useEffect(() => {
    OfferService.getOfferById(params.id).then((offer) => setOffer(offer.data));
  }, []);

  return (
    <div className="wrapper">
      <div className="product-img">
        <img src={offer.imageUrl} height="420" width="327" />
      </div>
      <div className="product-info">
        <div className="product-text">
          <h1>{offer.title}</h1>
          <h2></h2>
          <h5>Year: {offer.year}</h5>
          <h5>Engine: {offer.engine}</h5>
          <h5>Transmission: {offer.transmission}</h5>
          <h5>Kilometers: {offer.kilometers}</h5>
          <h5>ID Nummber: {offer.vehicleIdentificationNumber}</h5>
          <h5>{offer.description}</h5>
          <span>{offer.price}</span>$
        </div>
        <div className="product-price-btn">
          <p></p>
          <button type="button">buy now</button>
        </div>
      </div>
    </div>
  );
};
